import { Children } from "react";

import styled from "styled-components";

const Wrapper = styled.div`
  border-bottom: 1px solid red;
  display: flex;
  align-items: center;
  padding: 20px;
  width: 1005;
  &:first-child {
    border-top: 1px solid red;
  }
`;

function Row({ children }) {
  return <Wrapper>{children}</Wrapper>;
}

export default Row;
